-- Creación del schema para el proyecto:
DELIMITER ;
CREATE SCHEMA logistics_express;
USE logistics_express;

-- Creación de tabla Tipo de Vuelo:
DELIMITER ;
CREATE TABLE Tipo_Vuelo (
    ID_Tipo INT NOT NULL AUTO_INCREMENT PRIMARY KEY,
    Clasificacion_Vuelo CHAR(20) NOT NULL
);

-- Creación de tabla Registro de Aerolínea:
DELIMITER ;
CREATE TABLE Registro_Aerolinea (
    ID_Aerolinea INT NOT NULL AUTO_INCREMENT PRIMARY KEY,
    Nombre_Aerolinea VARCHAR(50) NOT NULL
);

-- Creación de tabla Registro de Aeronave:
DELIMITER ;
CREATE TABLE Registro_Aeronave (
    ID_Aeronave INT NOT NULL AUTO_INCREMENT PRIMARY KEY,
    Nombre_Aeronave VARCHAR(50) NOT NULL
);

-- Creación de tabla Código OACI aeropuertos de Argentina:
DELIMITER ;
CREATE TABLE OACI_Argentina (
    Codigo_OACI CHAR(10) NOT NULL PRIMARY KEY,
    Provincia VARCHAR(30) NOT NULL,
    Ciudad VARCHAR(50) NOT NULL,
    Nombre_Aeropuerto VARCHAR(50) NOT NULL
);

-- Creación de tabla Código OACI por país: 
DELIMITER ;
CREATE TABLE OACI_Pais (
    Codigo_OACI CHAR(5) NOT NULL PRIMARY KEY,
    Nombre_Pais VARCHAR(50) NOT NULL
);

-- Creación de tabla Segmentos de clientes:
DELIMITER ;
CREATE TABLE Segmento (
    ID_Segmento INT NOT NULL AUTO_INCREMENT PRIMARY KEY,
    Segmento VARCHAR(20) NOT NULL
);

-- Creación de tabla Clientes:
DELIMITER ;
CREATE TABLE Clientes (
    Cliente_ID INT NOT NULL AUTO_INCREMENT PRIMARY KEY,
    Nombre_Cliente VARCHAR(50) NOT NULL,
    Ciudad VARCHAR(50) NOT NULL,
    Estado VARCHAR(50) NOT NULL,
    Pais VARCHAR(50) NOT NULL,
    Region VARCHAR(30) NOT NULL,
    ID_Segmento INT NOT NULL,
    FOREIGN KEY (ID_Segmento)
        REFERENCES Segmento (ID_Segmento)
);

-- Creación de tabla Categoría de productos: 
DELIMITER ;
CREATE TABLE Categoria_Producto (
    ID_Categoria INT NOT NULL AUTO_INCREMENT PRIMARY KEY,
    Categoria_Producto VARCHAR(30) NOT NULL
);

-- Creación de tabla Productos:
DELIMITER ;
CREATE TABLE Productos (
    Producto_ID INT NOT NULL AUTO_INCREMENT PRIMARY KEY,
    ID_Categoria INT NOT NULL,
    Nombre_Producto VARCHAR(30) NOT NULL,
    Precio_Unitario INT NOT NULL,
    FOREIGN KEY (ID_Categoria)
        REFERENCES Categoria_Producto (ID_Categoria)
);

-- Creación de tabla Prioridad de Ordenes:
DELIMITER ;
CREATE TABLE Prioridad_Orden (
    ID_Prioridad INT NOT NULL AUTO_INCREMENT PRIMARY KEY,
    Prioridad_Orden VARCHAR(10) NOT NULL
);

-- Creación tabla Modo de Envío:
DELIMITER ;
CREATE TABLE Modo_Envio (
    ID_Modo_Envio INT NOT NULL AUTO_INCREMENT PRIMARY KEY,
    Modo_Envio VARCHAR(20) NOT NULL
);

-- Creación de tabla de Envíos:
DELIMITER ;
CREATE TABLE Envios (
    Orden_ID INT NOT NULL AUTO_INCREMENT PRIMARY KEY,
    Fecha_Orden DATE NOT NULL,
    Fecha_Envio DATE NOT NULL,
    Aging INT NOT NULL,
    ID_Modo_Envio INT NOT NULL,
    ID_Prioridad INT NOT NULL,
    FOREIGN KEY (ID_Modo_envio)
        REFERENCES Modo_Envio (ID_Modo_Envio),
    FOREIGN KEY (ID_Prioridad)
        REFERENCES Prioridad_Orden (ID_Prioridad)
);

-- Creación de tabla Ventas:
DELIMITER ;
CREATE TABLE Ventas (
    Venta_ID INT NOT NULL AUTO_INCREMENT PRIMARY KEY,
    Orden_ID INT NOT NULL,
    Cliente_ID INT NOT NULL,
    Producto_ID INT NOT NULL,
    Precio_Unitario INT NOT NULL,
    Cantidad INT NOT NULL,
    Descuento DECIMAL(3 , 2) NULL,
    Costo_Envio DECIMAL(4 , 2) NOT NULL,
    Ganancia DECIMAL(5 , 2) NOT NULL,
    FOREIGN KEY (Orden_ID)
        REFERENCES Envios (Orden_ID),
    FOREIGN KEY (Cliente_ID)
        REFERENCES Clientes (Cliente_ID),
    FOREIGN KEY (Producto_ID)
        REFERENCES Productos (Producto_ID)
);

-- Creación de tabla Vuelos Internacionales:
DELIMITER ;
CREATE TABLE Vuelos_Internacionales (
    Vuelo_ID INT NOT NULL AUTO_INCREMENT PRIMARY KEY,
    Orden_ID INT NOT NULL,
    Fecha_Envio DATE NOT NULL,
    Hora TIME NOT NULL,
    ID_Tipo INT NOT NULL,
    Origen CHAR(10) NOT NULL,
    Destino CHAR(5) NOT NULL,
    ID_Aerolinea INT NOT NULL,
    ID_Aeronave INT NOT NULL,
    FOREIGN KEY (Orden_ID)
        REFERENCES Envios (Orden_ID),
    FOREIGN KEY (ID_Tipo)
        REFERENCES Tipo_Vuelo (ID_Tipo),
    FOREIGN KEY (Origen)
        REFERENCES OACI_Argentina (Codigo_OACI),
    FOREIGN KEY (Destino)
        REFERENCES OACI_Pais (Codigo_OACI),
    FOREIGN KEY (ID_Aerolinea)
        REFERENCES Registro_Aerolinea (ID_Aerolinea),
    FOREIGN KEY (ID_Aeronave)
        REFERENCES Registro_Aeronave (ID_Aeronave)
);

-- Creación de tabla Vuelos en Argentina (cabotaje):
DELIMITER ;
CREATE TABLE Vuelos_Argentina (
    Vuelo_ID_Ar INT NOT NULL AUTO_INCREMENT PRIMARY KEY,
    Orden_ID INT NOT NULL,
    Fecha_Envio DATE NOT NULL,
    Hora TIME NOT NULL,
    ID_Tipo INT NOT NULL,
    Origen CHAR(10) NOT NULL,
    Destino CHAR(10) NOT NULL,
    ID_Aerolinea INT NOT NULL,
    ID_Aeronave INT NOT NULL,
    FOREIGN KEY (Orden_ID)
        REFERENCES Envios (Orden_ID),
    FOREIGN KEY (ID_Tipo)
        REFERENCES Tipo_Vuelo (ID_Tipo),
    FOREIGN KEY (Origen)
        REFERENCES OACI_Argentina (Codigo_OACI),
    FOREIGN KEY (Destino)
        REFERENCES OACI_Argentina (Codigo_OACI),
    FOREIGN KEY (ID_Aerolinea)
        REFERENCES Registro_Aerolinea (ID_Aerolinea),
    FOREIGN KEY (ID_Aeronave)
        REFERENCES Registro_Aeronave (ID_Aeronave)
);

-- Modificación de tablas para agregar columnas calculadas en trigger:
DELIMITER ;
ALTER TABLE ventas 
ADD Subtotal_Venta INT NOT NULL;

ALTER TABLE ventas 
ADD Descuento_Aplicado DECIMAL(7,2) NULL;

ALTER TABLE ventas 
ADD Total_Venta DECIMAL(10,2) NOT NULL;

-- Trigger antes de la inserción:
-- Creación de trigger para calcular el subtotal de la venta, el descuento aplicado y el total de la venta:
DELIMITER ;
DROP TRIGGER IF EXISTS Venta_BI;
DELIMITER &&
CREATE TRIGGER Venta_BI 
BEFORE INSERT ON ventas
FOR EACH ROW
BEGIN
	DECLARE variable_Subtotal_Venta INT;
    DECLARE variable_Descuento_Aplicado DECIMAL(7,2);
    DECLARE variable_Total_Venta DECIMAL(10,2);
	SET variable_Subtotal_Venta = NEW.Precio_Unitario * NEW.Cantidad;
    SET NEW.Subtotal_Venta = variable_Subtotal_Venta;
    
    SET variable_Descuento_Aplicado = variable_Subtotal_Venta * NEW.Descuento;
    SET NEW.Descuento_Aplicado = variable_Descuento_Aplicado;
    
    SET variable_Total_Venta = (variable_Subtotal_Venta - variable_Descuento_Aplicado) + NEW.Costo_Envio;
    SET NEW.Total_Venta = variable_Total_Venta;
END
&&

