-- Funciones
-- Creación de función para clasificar el estado de entrega de los envíos:
DELIMITER ;
DROP FUNCTION IF EXISTS Estado_Entrega;
DELIMITER $$
CREATE FUNCTION Estado_Entrega (dias INT)
				RETURNS VARCHAR (20)
                DETERMINISTIC
                NO SQL
BEGIN 
		CASE
        WHEN dias < 4 THEN 
        RETURN "A tiempo";
		WHEN dias > 7 THEN 
        RETURN "Crítico";
		ELSE 
        RETURN "Demorado"; 
        END CASE;
END
$$
