-- ORDER BY Aging;

-- Creación de función para clasificar el costo de envío:
DELIMITER ;
DROP FUNCTION IF EXISTS Clasificacion_CostoEnv;
DELIMITER $$
CREATE FUNCTION Clasificacion_CostoEnv (costo FLOAT)
				RETURNS VARCHAR (20)
                DETERMINISTIC
                NO SQL
BEGIN
		DECLARE Clasificacion VARCHAR (20);
        IF costo < 6 THEN
        SET Clasificacion = "Revisar";
        ELSEIF costo > 12 THEN
        SET Clasificacion = "Óptimo";
        ELSE
        SET Clasificacion = "Aceptable";
        END IF;
        RETURN Clasificacion;
END
$$
-- SELECT Costo_Envio, Clasificacion_CostoEnv(Costo_Envio) FROM ventas;

-- Creación de función para clasificar la rentabilidad mensual:
DELIMITER ;
DROP FUNCTION IF EXISTS Rentabilidad;
DELIMITER $$
CREATE FUNCTION Rentabilidad(param1 INT, param2 FLOAT)
				RETURNS VARCHAR (20)
                DETERMINISTIC
                NO SQL
BEGIN
		CASE
        WHEN (param1 * param2) > 400 THEN
        RETURN "Rentabilidad Alta";
        WHEN (param1 * param2) < 100 THEN
        RETURN "Rentabilidad Baja";
		ELSE
        RETURN "Rentabilidad Media";
        END CASE;
END
$$
