-- Vistas:

-- Creación vista Top 5 mayores ventas:
DELIMITER ;
CREATE OR REPLACE VIEW Top_5_Ventas AS
    (SELECT 
        P.Nombre_Producto,
        C.Categoria_Producto,
        SUM(V.Total_Venta) AS Total_Venta
    FROM
        ventas V
            JOIN
        productos P ON P.Producto_ID = V.Producto_ID
            JOIN
        categoria_producto c ON P.ID_Categoria = C.ID_Categoria
    GROUP BY C.Categoria_Producto , P.Nombre_Producto
    ORDER BY Total_Venta DESC
    LIMIT 5);
-- SELECT * FROM Top_5_Ventas;


-- Creación vista Cantidad de ordenes general:
DELIMITER ;
CREATE OR REPLACE VIEW Cantidad_Ordenes_Gen AS
    (SELECT 
        COUNT(E.Orden_ID) AS Cantidad_Ordenes,
        M.Modo_Envio,
        P.Prioridad_Orden,
        S.Segmento
    FROM
        envios E
            JOIN
        modo_envio M ON E.ID_Modo_Envio = M.ID_Modo_Envio
            JOIN
        prioridad_orden P ON E.ID_Prioridad = P.ID_Prioridad
            JOIN
        ventas V ON E.Orden_ID = V.Orden_ID
            JOIN
        clientes C ON V.Cliente_ID = C.Cliente_ID
            JOIN
        segmento S ON C.ID_Segmento = S.ID_Segmento
    GROUP BY S.Segmento , M.Modo_Envio , P.Prioridad_Orden , S.Segmento
    ORDER BY S.Segmento DESC , P.Prioridad_Orden DESC , M.Modo_Envio DESC);
-- SELECT * FROM Cantidad_Ordenes_Gen;


-- Creación vista Cantidad de clientes por segmento:
DELIMITER ;
CREATE OR REPLACE VIEW Clientes_Segmento AS
    (SELECT 
        COUNT(C.Cliente_ID) AS Cantidad_Clientes, S.Segmento
    FROM
        clientes C
            JOIN
        segmento S ON C.ID_Segmento = S.ID_Segmento
    GROUP BY S.Segmento
    ORDER BY Cantidad_Clientes DESC);
-- SELECT * FROM Clientes_Segmento;


-- Creación vista Ventas mensuales según segmento:
DELIMITER ;
CREATE OR REPLACE VIEW Ventas_Segmento AS
    (SELECT 
        MONTHNAME(E.Fecha_Orden) AS Fecha_Ordenes,
        S.Segmento,
        SUM(V.Total_Venta) AS Total_Venta
    FROM
        envios E
            INNER JOIN
        ventas V ON V.Orden_ID = E.Orden_ID
            INNER JOIN
        clientes C ON V.Cliente_ID = C.Cliente_ID
            INNER JOIN
        segmento S ON C.ID_Segmento = S.ID_Segmento
    GROUP BY Fecha_Ordenes , S.Segmento , MONTH(E.Fecha_Orden)
    ORDER BY MONTH(E.Fecha_Orden));
-- SELECT * FROM Ventas_Segmento;


-- Creación vista Cantidad de clientes según demora de envio:
DELIMITER ;
CREATE OR REPLACE VIEW Clientes_DemoraEnv AS
    (SELECT 
        COUNT(V.Cliente_ID) AS Cantidad_Clientes,
        Aging,
        (SELECT ESTADO_ENTREGA(E.Aging)) AS Estado_Entrega
    FROM
        envios E
            JOIN
        ventas V ON E.Orden_ID = V.Orden_ID
    GROUP BY Aging , Estado_Entrega
    ORDER BY Aging ASC);
-- SELECT * FROM Clientes_DemoraEnv;


-- Creación vista Descuentos:
DELIMITER ;
CREATE OR REPLACE VIEW Descuentos_Aplicados AS
    (SELECT 
        COUNT(C.Cliente_ID) AS Cantidad_Clientes,
        S.Segmento,
        CP.Categoria_Producto,
        SUM(V.Descuento_Aplicado) AS Descuento_Aplicado
    FROM
        clientes C
            JOIN
        segmento S ON C.ID_Segmento = S.ID_Segmento
            JOIN
        ventas V ON C.Cliente_ID = V.Cliente_ID
            JOIN
        productos P ON V.Producto_ID = P.Producto_ID
            JOIN
        categoria_producto CP ON P.ID_Categoria = CP.ID_Categoria
    GROUP BY S.Segmento , CP.Categoria_Producto
    ORDER BY S.Segmento , CP.Categoria_Producto DESC);
-- SELECT * FROM Descuentos_Aplicados;


-- Creación de vista Revisión del costo de envío:
DELIMITER ;
CREATE OR REPLACE VIEW Revision_CostoEnv AS
    (SELECT 
        ME.Modo_Envio,
        ROUND(AVG(V.Costo_Envio), 2) AS Promedio_CostoEnv,
        (SELECT CLASIFICACION_COSTOENV(Costo_Envio)) AS Clasificación_Costo
    FROM
        ventas V
            JOIN
        envios E ON V.Orden_ID = E.Orden_ID
            JOIN
        modo_envio ME ON E.ID_Modo_Envio = ME.ID_Modo_Envio
    GROUP BY ME.Modo_Envio , Clasificación_Costo
    ORDER BY Promedio_CostoEnv ASC);
-- SELECT * FROM Revision_CostoEnv;


-- Creación vista Cantidad de ordenes según categoría de productos:
DELIMITER ;
CREATE OR REPLACE VIEW Ordenes_Categoria AS
    (SELECT 
        COUNT(V.Orden_ID) AS Cantidad_Ordenes, CP.Categoria_Producto
    FROM
        ventas V
            JOIN
        productos P ON V.Producto_ID = P.Producto_ID
            JOIN
        categoria_producto CP ON P.ID_Categoria = CP.ID_Categoria
    GROUP BY CP.Categoria_Producto
    ORDER BY CP.Categoria_Producto ASC);
-- SELECT * FROM Ordenes_Categoria;


-- Creación vista Rentabilidad mensual de ganancias:
DELIMITER ;
CREATE OR REPLACE VIEW Rentabilidad_Ganancias AS
    (SELECT 
        MONTHNAME(E.Fecha_Orden) AS Fecha_Ordenes,
        SUM(V.Cantidad * V.Ganancia) AS Ganancia_Total,
        (SELECT RENTABILIDAD(V.Cantidad, V.Ganancia)) AS Rentabilidad
    FROM
        ventas V
            JOIN
        envios E ON V.Orden_ID = E.Orden_ID
    GROUP BY Fecha_Ordenes , Rentabilidad , MONTH(E.Fecha_Orden)
    ORDER BY MONTH(E.Fecha_Orden) ASC);
-- SELECT * FROM Rentabilidad_Ganancias;


-- Creación vista Top países con más compras:
DELIMITER ;
CREATE OR REPLACE VIEW Top_Paises AS
    (SELECT 
        C.Pais, SUM(V.Total_Venta) AS Total_Venta, S.Segmento
    FROM
        clientes C
            JOIN
        ventas V ON C.Cliente_ID = V.Cliente_ID
            JOIN
        segmento S ON C.ID_Segmento = S.ID_Segmento
    WHERE
        C.Pais IN (SELECT 
                C.Pais
            FROM
                clientes C
                    JOIN
                ventas V ON C.Cliente_ID = V.Cliente_ID
            GROUP BY C.Pais
            ORDER BY SUM(V.Total_Venta) DESC)
    GROUP BY C.Pais , S.Segmento
    ORDER BY Total_Venta DESC
    LIMIT 10);
-- SELECT * FROM Top_Paises;

-- Creación vista Top 10 Ventas Nacionales:
DELIMITER ;
CREATE OR REPLACE VIEW Top_10_VentasProv AS
    (SELECT 
        OA.Provincia,
        OA.Nombre_Aeropuerto,
        RA.Nombre_Aerolinea,
        RN.Nombre_Aeronave,
        SUM(V.Total_Venta) AS Total_Venta
    FROM
        vuelos_argentina VA
            JOIN
        envios E ON VA.Orden_ID = E.Orden_ID
            JOIN
        ventas V ON E.Orden_ID = V.Orden_ID
            JOIN
        oaci_argentina OA ON VA.Destino = OA.Codigo_OACI
            JOIN
        registro_aerolinea RA ON VA.ID_Aerolinea = RA.ID_Aerolinea
            JOIN
        registro_aeronave RN ON VA.ID_Aeronave = RN.ID_Aeronave
            JOIN
        clientes C ON V.Cliente_ID = C.Cliente_ID
    WHERE
        C.Pais = 'Argentina'
    GROUP BY OA.Provincia , OA.Nombre_Aeropuerto , RA.Nombre_Aerolinea , RN.Nombre_Aeronave
    ORDER BY Total_Venta DESC
    LIMIT 10);
-- SELECT * FROM Top_10_VentasProv;

-- Creación vista Top 10 Ventas Internacionales:
DELIMITER ;
CREATE OR REPLACE VIEW Top_10_VentasInt AS
    (SELECT 
        OP.Nombre_Pais,
        RA.Nombre_Aerolinea,
        RN.Nombre_Aeronave,
        SUM(V.Total_Venta) AS Total_Venta
    FROM
        vuelos_internacionales VI
            JOIN
        envios E ON VI.Orden_ID = E.Orden_ID
            JOIN
        ventas V ON E.Orden_ID = V.Orden_ID
            JOIN
        oaci_pais OP ON VI.Destino = OP.Codigo_OACI
            JOIN
        registro_aerolinea RA ON VI.ID_Aerolinea = RA.ID_Aerolinea
            JOIN
        registro_aeronave RN ON VI.ID_Aeronave = RN.ID_Aeronave
            JOIN
        clientes C ON V.Cliente_ID = C.Cliente_ID
    WHERE
        C.Pais != 'Argentina'
    GROUP BY OP.Nombre_Pais , RA.Nombre_Aerolinea , RN.Nombre_Aeronave
    ORDER BY Total_Venta DESC
    LIMIT 10);
-- SELECT * FROM Top_10_VentasInt;

-- Store Procedures:

-- Creación SP para TOP productos más vendidos en un período de tiempo determinado:
DELIMITER ;
DROP PROCEDURE IF EXISTS TOP_mas_vendidos;
DELIMITER //
CREATE PROCEDURE TOP_mas_vendidos(IN Fecha_Inicio DATE, 
								  IN Fecha_Final DATE)
BEGIN
	DECLARE Total_Cantidad INT DEFAULT 0;
	DECLARE EXIT HANDLER FOR SQLEXCEPTION, NOT FOUND, SQLWARNING
	BEGIN
		ROLLBACK;
		SELECT "Error";
	END;

	START TRANSACTION;
	
	SELECT 
		P.Nombre_Producto, 
		SUM(V.Cantidad) AS Total_Cantidad
    FROM 
		productos P
			JOIN 
		ventas V ON P.Producto_ID = V.Producto_ID
			JOIN 
		envios E ON V.Orden_ID = E.Orden_ID
    WHERE 
		E.Fecha_Orden BETWEEN Fecha_Inicio AND Fecha_Final
    GROUP BY P.Nombre_Producto
    ORDER BY Total_Cantidad DESC
    LIMIT 10
	INTO Total_Cantidad;
    
	SELECT "Felicidades, fue ejecutado con éxito";
	COMMIT;
END
//
-- DELIMITER ;
-- CALL TOP_mas_vendidos("2015-06-01", "2015-11-30");

-- Creación SP para Total de ventas de un producto en un período de tiempo determinado:
DELIMITER ;
DROP PROCEDURE IF EXISTS Ventas_producto;
DELIMITER //
CREATE PROCEDURE Ventas_producto(IN Nombre VARCHAR(30), 
								 IN Fecha_Inicio DATE, 
                                 IN Fecha_Final DATE, 
                                 OUT Total DECIMAL(7,2))
BEGIN
	DECLARE EXIT HANDLER FOR SQLEXCEPTION, NOT FOUND, SQLWARNING
	BEGIN
		ROLLBACK;
		SELECT "Error";
	END;

	START TRANSACTION;
	
	SELECT 
		SUM(V.Total_Venta) AS Total_Venta
    FROM 
		ventas V
			JOIN 
		productos P ON V.Producto_ID = P.Producto_ID
			JOIN 
		envios E ON V.Orden_ID = E.Orden_ID
    WHERE 
		P.Nombre_Producto = Nombre AND E.Fecha_Orden BETWEEN Fecha_Inicio AND Fecha_Final
    INTO Total;
    
	SELECT "Felicidades, fue ejecutado con éxito";
	COMMIT;
END
//
-- DELIMITER ;
-- CALL Ventas_producto("Apple Laptop", "2015-08-01", "2015-10-31", @Total);
