-- Creación SP para Calcular precio máximo, mínimo y la media de productos de una categoría:
DELIMITER ;
DROP PROCEDURE IF EXISTS Max_Min_Media;
DELIMITER //
CREATE PROCEDURE Max_Min_Media(IN Categoria VARCHAR(30),
								OUT Maximo INT,
                                OUT Minimo INT,
                                OUT Media INT)
BEGIN
	DECLARE EXIT HANDLER FOR SQLEXCEPTION, NOT FOUND, SQLWARNING
	BEGIN
		ROLLBACK;
		SELECT "Error";
	END;

	START TRANSACTION;
	
	SELECT 
		MAX(P.Precio_Unitario),
		MIN(P.Precio_Unitario),
		AVG(P.Precio_Unitario)
	FROM 
		productos P
			JOIN 
		categoria_producto CP ON P.ID_Categoria = CP.ID_Categoria
    WHERE 
		CP.Categoria_Producto = Categoria
    INTO Maximo, Minimo, Media;
	
	SELECT "Felicidades, fue ejecutado con éxito";
	COMMIT;
END
//
