-- Triggers

-- Creación de trigger para actualizar el cálculo del subtotal de la venta, el descuento aplicado y el total de la venta:
DELIMITER ;
DROP TRIGGER IF EXISTS Venta_BU;
DELIMITER &&
CREATE TRIGGER Venta_BU
BEFORE UPDATE ON ventas
FOR EACH ROW
BEGIN
	DECLARE variable_Subtotal_Venta INT;
    DECLARE variable_Descuento_Aplicado DECIMAL(7,2);
    DECLARE variable_Total_Venta DECIMAL(10,2);
	SET variable_Subtotal_Venta = NEW.Precio_Unitario * NEW.Cantidad;
    SET NEW.Subtotal_Venta = variable_Subtotal_Venta;
    
    SET variable_Descuento_Aplicado = variable_Subtotal_Venta * NEW.Descuento;
    SET NEW.Descuento_Aplicado = variable_Descuento_Aplicado;
    
    SET variable_Total_Venta = (variable_Subtotal_Venta - variable_Descuento_Aplicado) + NEW.Costo_Envio;
    SET NEW.Total_Venta = variable_Total_Venta;
END
&&
-- Creación trigger para validar ingreso de Código OACI vuelos internacionales:
DELIMITER ;
DROP TRIGGER IF EXISTS ValidarOACIP_BI_part1;
DELIMITER //
CREATE TRIGGER ValidarOACIP_BI_part1
BEFORE INSERT ON vuelos_internacionales
FOR EACH ROW
BEGIN
    DECLARE v_origen_existente INT;
    
SELECT 
    COUNT(*)
INTO v_origen_existente FROM
    oaci_argentina OA
        JOIN
    vuelos_internacionales VI ON OA.Codigo_OACI = VI.Origen
WHERE
    OA.Codigo_OACI = NEW.Origen;
    
